import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import {Grid, Row, Col, Image, Button } from 'react-bootstrap';

export default class Home extends Component {
	render() {
		return (
			<Grid>
					<Row className="show-grid">
						<Col md={6} mdPull={6}>
							<Image src="assets/image1.jpg"/>
						</Col>
						<Col md={6} mdPush={6}>
							Bacon ipsum dolor amet doner bacon shankle hamburger, ham corned beef chuck. Doner meatloaf capicola tri-tip burgdoggen beef spare ribs tongue turkey andouille salami chuck ground round.
						</Col>
					</Row>

		</Grid>
			)
	}
}
